script: |
  super -f text -I q4655.spq | sort > q4655.out

inputs:
  - name: q4655.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE 96 NOT BETWEEN - - col0 + col2 AND - CAST ( NULL AS INTEGER ) * + col2;
  - name: tab1

outputs:
  - name: q4655.out
    data: |
      51	14	96
      85	5	59
      91	47	68
